css:
.github-CommitDetailView {
  display: flex;
  flex-direction: column;
  height: 100%;
}
.github-CommitDetailView-header {
  flex: 0;
  border-bottom: 1px solid #c7c7c7;
  background-color: #1d1f21;
}
.github-CommitDetailView-commit {
  padding: 24px;
  padding-bottom: 0;
}
.github-CommitDetailView-title {
  margin: 0 0 .25em 0;
  font-size: 1.4em;
  line-height: 1.3;
  color: #000000;
}
.github-CommitDetailView-avatar {
  border-radius: 6px;
  height: 16px;
  margin-right: .4em;
  width: 16px;
}
.github-CommitDetailView-meta {
  display: flex;
  align-items: center;
  margin: 6px 0 24px 0;
}
.github-CommitDetailView-metaText {
  flex: 1;
  margin-left: 20.8px;
  line-height: 16px;
  color: #999999;
}
.github-CommitDetailView-moreButton {
  position: absolute;
  left: 50%;
  transform: translate(-50%, -50%);
  padding: 0em .4em;
  color: #999999;
  font-style: italic;
  border: 1px solid #c7c7c7;
  border-radius: 6px;
  background-color: #ffffff;
}
.github-CommitDetailView-moreButton:hover {
  background-color: #ffffff;
}
.github-CommitDetailView-moreText {
  padding: 24px 0;
  font-size: inherit;
  font-family: var(--editor-font-family);
  word-wrap: initial;
  word-break: break-word;
  white-space: pre-wrap;
  border-top: 1px solid #c7c7c7;
  background-color: transparent;
  max-height: 55vh;
}
.github-CommitDetailView-moreText:empty {
  display: none;
}
.github-CommitDetailView-sha {
  flex: 0 0 7ch;
  margin-left: 24px;
  line-height: 16px;
  color: #999999;
  font-family: var(--editor-font-family);
  white-space: nowrap;
  overflow: hidden;
}
.github-CommitDetailView-sha a {
  color: #057eff;
}
